function add_one(speakers)
	local index = speakers.i;
	local len = #speakers.s;

	if index + 1 > len then
		speakers.i = 1;
		return;
	end

	speakers.i += 1;
end

function getMidi(note_number)
	return MIDI_TABLE[note_number + 1];
end

function getNote(note_str)
	local note = note_str:gmatch("%u#?");
	local octave = note_str:gmatch("%-?%d+");

	for n in note do note = n end
	for o in octave do octave = tonumber(o) end

	-- todo: fix yandere dev...
	if octave == 2 then
		local speakers = A2[note];
		local speaker = A2[note].s[speakers.i];

		add_one(speakers);

		return speaker;
	elseif octave == 3 then
		local speakers = A3[note];
		local speaker = A3[note].s[speakers.i];

		add_one(speakers);

		return speaker;
	elseif octave == 4 then
		local speakers = A4[note];
		local speaker = A4[note].s[speakers.i];

		add_one(speakers);

		return speaker;
	elseif octave == 5 then
		local speakers = A5[note];
		local speaker = A5[note].s[speakers.i];

		add_one(speakers);

		return speaker;
	elseif octave == 6 then
		local speakers = A6[note];
		local speaker = A6[note].s[speakers.i];

		add_one(speakers);

		return speaker;
	elseif octave == 7 then
		local speakers = A7[note];
		local speaker = A7[note].s[speakers.i];

		add_one(speakers);

		return speaker;
	end

	return nil;
end

function getLight(note_str)
	local note = note_str:gmatch("%u#?");
	local octave = note_str:gmatch("%-?%d+");

	for n in note do note = n end
	for o in octave do octave = tonumber(o) end

	-- yandere dev will never get fixed :carbon_monoxide:
	if octave == 1 then
		return LA1[note];
	elseif octave == 2 then
		return LA2[note];
	elseif octave == 3 then
		return LA3[note];
	elseif octave == 4 then
		return LA4[note]
	elseif octave == 5 then
		return LA5[note]
	elseif octave == 6 then
		return LA6[note]
	elseif octave == 7 then
		return LA7[note]
	elseif octave == 8 then
		return LA8[note]
		--elseif octave == 9 then
		--	return LA9[note]
	end
end

function isSharp(note)
	return string.find(note, "#");
end

function GetPortByID(ports, id)
    for i, port in ports do
        if port.PortID == id then
            return port
        end
    end
end

